import React, { useState } from "react";
import { Table } from "react-bootstrap";


const TableP = () => 
{
    const [Matches, setMatches] = useState('1')
    return(
    <>
    <div>
        <body>
            <Table striped bordered>
                <thead>
                    <tr width='100%'>
                        Weekly Finals
                    </tr>
                </thead>
                <thead>
                    <tr>Team</tr>
                    {
                       Matches.map((Match) => {
                            return <tr>Match</tr>  
                        }  )
                    }
                </thead>
            </Table>
        </body>
    </div>
    </>
    )
}

export default TableP;
